import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
// import AuthService from '../auth/auth-service';

class Navbar extends Component {
  constructor(props){
    super(props);
    this.state = { loggedInUser: null };
    // this.service = new AuthService();
  }

  componentDidMount() {
    debugger
    let user= this.props.getUser(); 
    this.setState({loggedInUser:user})
  }

  active(event){
    let element = event.currentTarget;
    element.className += " underlined";

    // element.classList.addClass("underlined");
}

  render(){
    if(this.state.loggedInUser){
      return(
        <nav className="Navbar" style={{backgroundColor:"#334455", opacity:"0.7"}}>
          {/* <Link to="/" style={{textDecoration:"none", color: "white"}}><h3>grandMeet</h3></Link> */}
          {/* <div className="navItems"> */}
          <Link to="/" style={{textDecoration:"none", color: "white"}}><h3>grandMeet</h3></Link>
          <div className="NavbarRight">
          <Link to="/profile" onClick={this.active} style={{color: "white"}}><h4 className="navItem">Profile</h4></Link>
          <Link to="/nearby" onClick={this.active} style={{color: "white"}}><h4 className="navItem">Nearby</h4></Link>
          <Link to="/share" onClick={this.active} style={{color: "white"}} ><h4 className="navItem">Share</h4></Link>
          <Link to="/inbox" onClick={this.active} style={{color: "white"}}><h4 className="navItem">Inbox</h4></Link>
          </div>
          {/* </div> */}
        </nav>
      )
    } else {
      return ( 
        <nav className="Navbar">
            <Link to="/" style={{textDecoration:"none", color: "white"}}><h3>grandMeet</h3></Link>
            <Link to='/login' style={{ textDecoration: 'none', color:"white"}}>Login</Link>
        </nav>
      )
    }
  }
}

export default Navbar;
